package LeetCode.LeetCodeString;

import org.junit.jupiter.api.Test;

import java.util.HashMap;
import java.util.Iterator;
import java.util.Map;

import static org.hamcrest.MatcherAssert.assertThat;
import static org.hamcrest.Matchers.is;

public class ValidAnagram {

    public boolean isAnagram(String s, String t) {
        if (s.length() != t.length()) return false;
        Map<Character, Integer> aMap = new HashMap<>();
        for (int i = 0; i < s.length(); i++) {
            aMap.put(s.charAt(i), aMap.getOrDefault(s.charAt(i), 0)+1);
        }
        Map<Character, Integer> aMap2 = new HashMap<>();
        for (int i = 0; i < t.length(); i++) {
            aMap2.put(t.charAt(i), aMap2.getOrDefault(t.charAt(i), 0)+1);
        }

        Iterator<Character> anIt = aMap.keySet().iterator();
        Character tmp;
        while (anIt.hasNext()) {
            tmp = anIt.next();
            if (!aMap2.containsKey(tmp)) return false;
            if (aMap.get(tmp).intValue() != aMap2.get(tmp).intValue())
                return false;
        }
        anIt = aMap2.keySet().iterator();
        while (anIt.hasNext()) {
            tmp = anIt.next();
            if (!aMap.containsKey(tmp)) return false;
            if (aMap.get(tmp).intValue() != aMap2.get(tmp).intValue())
                return false;
        }
        return true;
    }

    @Test
    public void test() {
        assertThat(isAnagram("anagram", "nagaram"), is(true));
        assertThat(isAnagram("rat", "car"), is(false));
        assertThat(isAnagram("", ""), is(true));
    }
}
